export const dashboard = <i className="fa-solid fa-chart-line"></i>;
export const transactions = <i className="fa-solid fa-credit-card"></i>;
export const categories = <i className="fa-solid fa-tags"></i>;
export const accounts = <i className="fa-solid fa-wallet"></i>;
export const settings = <i className="fa-solid fa-cog"></i>;
export const logout = <i className="fa-solid fa-sign-out"></i>;
export const income = <i className="fa-solid fa-money-bill-trend-up"></i>;
export const expenses = <i className="fa-solid fa-money-bill-transfer"></i>;
export const money = <i className="fa-solid fa-money-bill"></i>;
export const earth = <i className="fa-solid fa-earth-americas"></i>;
export const invest = <i className="fa-solid fa-arrow-trend-up"></i>;
export const saving = <i className="fa-solid fa-piggy-bank"></i>;
export const card = <i className="fa-brands fa-cc-visa"></i>;
export const dividen = <i className="fa-solid fa-users-between-lines"></i>;
export const rupiah = <i className="fa-solid fa-rupiah-sign"></i>;
export const calender = <i className="fa-solid fa-calendar"></i>;
export const comment = <i className="fa-solid fa-comment"></i>;
export const plus = <i className="fa-solid fa-plus"></i>;
export const trash = <i className="fa-solid fa-trash"></i>;
export const signout = <i className="fa-solid fa-right-from-bracket"></i>;
export const food = <i className="fa-solid fa-utensils"></i>;
export const clothing = <i className="fa-solid fa-shirt"></i>;
export const book = <i className="fa-solid fa-book-open"></i>;
export const medical = <i className="fa-solid fa-briefcase-medical"></i>;
export const other = <i className="fas fa-ellipsis-h"></i>;
export const travelling = <i className="fa-solid fa-plane"></i>;
export const gift = <i className="fas fa-gift"></i>;
export const refund = <i className="fas fa-undo-alt"></i>;
export const award = <i className="fas fa-award"></i>;
export const sale = <i className="fas fa-store"></i>;
export const rental = <i className="fas fa-store-alt"></i>;
export const insurance = <i className="fas fa-dove"></i>;
export const baby = <i className="fas fa-baby"></i>;
export const shopping = <i className="fas fa-shopping-cart"></i>;
export const fruit = <i className="fas fa-apple-alt"></i>;
export const snack = <i className="fas fa-cookie-bite"></i>;
export const electronic = <i className="fas fa-desktop"></i>;
export const pets = <i className="fas fa-cat"></i>;
export const coffee = <i className="fas fa-mug-hot"></i>;
export const entertainment = <i className="fas fa-gamepad"></i>;
export const office = <i className="fas fa-briefcase"></i>;
export const cigaret = <i className="fas fa-smoking"></i>;
export const beauty = <i className="fas fa-grin-tears"></i>;
export const car = <i className="fas fa-car-side"></i>;
export const motorcycle = <i className="fas fa-motorcycle"></i>;
export const sport = <i className="fas fa-running"></i>;
export const tax = <i className="fas fa-balance-scale"></i>;
export const internet = <i className="fas fa-wifi"></i>;
export const home = <i className="fas fa-home"></i>;
export const charity = <i className="fas fa-hand-holding-heart"></i>;
export const social = <i className="fas fa-hands-helping"></i>;
export const bill = <i className="fas fa-money-bill-wave"></i>;
export const electric = <i className="fas fa-bolt"></i>;
